import CancelImg from './image/Cancel.png';
import CancelClear from './image/CancelClear.png'

const CancelImage = [CancelClear, CancelImg];


function LoginCancelBtn({ value = '' }) {
    return (
        <button className='cancel-container'>
            <img src={CancelImage} alt='취소' className='cancel-img'></img>
        </button>
    )
}

export default LoginCancelBtn;
